class Vendor {
  final int id;
  final String code;
  final String name;
  final String email;
  final String mobile;
  final String beneficiaryName;
  final String status;

  Vendor({
    required this.id,
    required this.code,
    required this.name,
    required this.email,
    required this.mobile,
    required this.beneficiaryName,
    required this.status,
  });
}
